import { Route, Switch } from 'react-router-dom';

const App = () => (
  <div>
  <header>
<h1>Header</h1>
  <Navigation />
  <Switch>
    <Route exact path ="/">
     <InmateList />
    </Route>
    <Route exact path = "/InmateList">
      <About/>
    </Route>
    <Route exact path = "/FacilityList">
      <Contact/>
    </Route>
    </Switch>
  </header>
    <div>hi</div>
  </div>
);

export default App;
